def uint(num: int):
    return num & 0xFFFFFFFF


def unBitshiftLeftXor(value: int, shift: int):
    i = 0

    while i * shift < 32:
        partMask = ((0xFFFFFFFF >> (32 - shift)) << (shift * i)) & 0xFFFFFFFF
        part = value & partMask
        value ^= ((part << shift) & 0xFFFFFFFF)
        i += 1

    return value


