        state[a + 1] = unBitshiftLeftXor(state[a + 1], 8)

        # reverse a + 2
        state[a + 2] ^= uint(state[d + 2] << 18)
        state[a + 2] ^= (state[b + 2] >> 11) & 0xbffaffff
        state[a + 2] ^= state[c + 2] >> 8
        state[a + 2] ^= uint(state[c + 3] << 24)
        state[a + 2] ^= state[a + 1] >> 24
        state[a + 2] = unBitshiftLeftXor(state[a + 2], 8)

        # reverse a + 3
        state[a + 3] ^= uint(state[d + 3] << 18)
        state[a + 3] ^= (state[b + 3] >> 11) & 0xbffffff6
